import React from "react";
import "./HomePage.css"; // Importing the CSS file
import Navbar from "./Navbar";

const Home = () => {
  return (
    <>
    <Navbar/>
    <div className="homepage">
      {/* Hero Section */}
      <section className="hero">
        <h1>Welcome to HealthCare Portal</h1>
        <p>Your Trusted Medical Assistance Platform</p>
        <button className="btn">Get Started</button>
      </section>

      {/* About Us Section */}
      <section className="about">
        <h2>About Us</h2>
        <p>
          We provide the best medical consultation services with top professionals.
          Your health is our priority.
        </p>
      </section>

      {/* Contact Us Section */}
      <section className="contact">
        <h2>Contact Us</h2>
        <form>
          <input type="text" placeholder="Your Name" required />
          <input type="email" placeholder="Your Email" required />
          <textarea placeholder="Your Message" required></textarea>
          <button type="submit" className="btn">Submit</button>
        </form>
      </section>

      {/* Footer Section */}
      <footer className="footer">
        <p>&copy; 2025 HealthCare Portal. All Rights Reserved.</p>
      </footer>
    </div>
    </>
  );
};
